void checkEnabled()
{
    WMSOrderTrans       wmsOrderTransLocal;

    select firstonly RecId from wmsOrderTransLocal
        where wmsOrderTransLocal.ShipmentId == wmsShipment.ShipmentId
           && wmsOrderTransLocal.ExpeditionStatus != WMSExpeditionStatus::Cancelled
           && wmsOrderTransLocal.ExpeditionStatus != WMSExpeditionStatus::Complete;

    wmsShipment_ds.object(fieldNum(WMSShipment,InventSiteId)).allowEdit(wmsOrderTransLocal.RecId == 0 || wmsShipment.RecId == 0);

    wmsShipment_ds.object(fieldNum(WMSShipment,InventLocationId)).allowEdit(wmsShipment.isEditable());

    shipFrom_inventLocationId.mandatory(false);
    shipFrom_outputPort.mandatory(false);

    wmsShipment_ds.object(fieldNum(WMSShipment, AutoAddStop)).allowEdit(false);
    wmsShipment_ds.object(fieldNum(WMSShipment, PackingType)).allowEdit(false);

    // <GEERU>
    if (SysCountryRegionCode::isLegalEntityInCountryRegion([#isoRU]))
    {
        wmsShipment_ds.allowEditTransportationPayer_RU();
    }
    // </GEERU>

    if (!wmsShipment.RecId)
    {
        // New shipment
        sendASN.enabled(false);
        inqueries.enabled(false);
        wmsShipment_ds.allowEdit(true);
    }
    else
    {
        // Existing shipment
        inqueries.enabled(true);

        //ship
        wmsShipment_ds.allowEdit(wmsShipment.isEditable());

        if (wmsShipment.custPackingSlipExists())
        {
            sendASN.enabled(true);
        }
        else
        {
            sendASN.enabled(false);
        }

        this.enableOrderSpecificButtons();
    }
}

void close()
{
    if (! wmsShipment.RecId && numberSeq)
    {
        numberSeq.abort();
    }

    super();
}

void doRefresh()
{
    wmsShipment_ds.reread();
    wmsShipment_ds.refresh();
    element.checkEnabled();
}

