/// <summary>
/// Enables buttons that are specific to Sales and Transfer Orders.
/// </summary>
void enableOrderSpecificButtons()
{
    WMSShipment localWMSShipment;
    boolean     hasSalesOrder;
    boolean     hasTransferOrder;
    boolean     enablePackingSlipButton;
    boolean     canPhysicalUpdTransferOrder;
    boolean     allCanBeDirectlyInvoiced    = true;
    boolean     allPackedAndNotInvoiced     = true;
    boolean     allHasBeenInvoiced          = true;
    boolean     shipmentExists;
    container   enablementInfo;

    for (localWMSShipment = wmsShipment_ds.getFirst(true) ? wmsShipment_ds.getFirst(true) : wmsShipment_ds.cursor(); localWMSShipment; localWMSShipment = wmsShipment_ds.getNext())
    {
        shipmentExists = true;

        enablementInfo = localWMSShipment.getOrderSpecificButtonInfo(
                hasSalesOrder,
                hasTransferOrder,
                enablePackingSlipButton,
                canPhysicalUpdTransferOrder,
                allCanBeDirectlyInvoiced,
                allPackedAndNotInvoiced,
                allHasBeenInvoiced);

        hasSalesOrder               = conPeek(enablementInfo, WMSShipment::posHasSalesOrder());
        hasTransferOrder            = conPeek(enablementInfo, WMSShipment::posHasTransferOrder());
        enablePackingSlipButton     = conPeek(enablementInfo, WMSShipment::posCanPhysicalUpdSalesOrder());
        canPhysicalUpdTransferOrder = conPeek(enablementInfo, WMSShipment::posCanPhysicalUpdTransferOrder());

        allCanBeDirectlyInvoiced    = conPeek(enablementInfo, WMSShipment::posAllCanBeDirectlyInvoiced());
        allPackedAndNotInvoiced     = conPeek(enablementInfo, WMSShipment::posAllPackedAndNotInvoiced());
        allHasBeenInvoiced          = conPeek(enablementInfo, WMSShipment::posAllHasBeenInvoiced());

        if (hasSalesOrder
         && hasTransferOrder
         && enablePackingSlipButton
         && canPhysicalUpdTransferOrder
         && !allHasBeenInvoiced
         && !allCanBeDirectlyInvoiced
         && !allPackedAndNotInvoiced)
        {
            break;
        }
    }

    if (!shipmentExists)
    {
        allCanBeDirectlyInvoiced    = false;
        allPackedAndNotInvoiced     = false;
        allHasBeenInvoiced          = false;
    }

    salesFormLetter_PackingSlip.enabled(hasSalesOrder && enablePackingSlipButton);

    inventTransferShip.enabled(hasTransferOrder && canPhysicalUpdTransferOrder);
}

