void run()
{
    boolean enabledShipmentId = WMSShipment::isNumberSeqManual();

    wmsShipment_ds.object(fieldNum(WMSShipment, ShipmentId)).allowEdit(enabledShipmentId);
    wmsShipment_ds.object(fieldNum(WMSShipment, ShipmentId)).skip(!enabledShipmentId);

    super();
}

void setProgressSelection(WMSShipmentProgressSelection _selection = WMSShipmentProgressSelection::All)
{
    Query query = wmsShipment_ds.queryRun() ? wmsShipment_ds.queryRun().query() : wmsShipment_ds.query();
    WMSShipment::modifyQueryForInProgress(_selection, query);
}

public void updateDesign(InventDimFormDesignUpdate _mode)
{
    switch (_mode)
    {
        case InventDimFormDesignUpdate::Init            :
            if (!inventDimFormSetup)
            {
                inventDimFormSetup  = InventDimCtrl::newFromForm(element);
            }
        // continue to Active case
        case InventDimFormDesignUpdate::Active          :
            inventDimFormSetup.formActiveSetup(InventDimGroupSetup::newItemId(wmsOrderTrans.ItemId));
            inventDimFormSetup.formSetControls(true);
            break;
        case InventDimFormDesignUpdate::FieldChange     :
            inventDimFormSetup.formActiveSetup(InventDimGroupSetup::newItemId(wmsOrderTrans.ItemId));
            inventDimFormSetup.formSetControls(false);
            break;
        default : throw error(strFmt("@SYS54195",funcName()));
    }
    WMSShipmentAddresses.enabled(WMSOrderTrans.inventTransType == InventTransType::Sales);
    WMSShipmentAddressesTransfer.enabled(WMSOrderTrans.inventTransType == InventTransType::TransferOrderShip);
}

