public void initValue()
{
    super();
    wmsShipment.Status = WMSShipmentStatus::Registered;
    if (!externalCreation && ! wmsShipment.RecId)
    {
        numberSeq = WMSShipment::numberSeq(true,true);
        if (numberSeq)
        {
            wmsShipment.ShipmentId = numberSeq.num();
        }
    }
}

void write()
{
    #OCCRetryCount
    WMSLocationId     oldLocation = wmsShipment.orig().OutputPort;

    ttsbegin;
    if (numberSeq)
    {
        numberSeq.used();
    }

    super();

    if (oldLocation != wmsShipment.OutputPort)
    {
        try
        {
            ttsbegin;
            wmsShipment.changeOutputLocation(wmsShipment.OutputPort);
            ttscommit;
        }
        catch (Exception::Deadlock)
        {
            retry;
        }
        catch (Exception::UpdateConflict)
        {
            if (appl.ttsLevel() == 0)
            {
                if (xSession::currentRetryCount() >= #RetryNum)
                {
                    throw Exception::UpdateConflictNotRecovered;
                }
                else
                {
                    retry;
                }
            }
            else
            {
                throw Exception::UpdateConflict;
            }
        }
    }
    ttscommit;
}

