void clicked()
{
    wmsOrderTrans   localWmsOrderTrans;
    WMSShipment     wmsShipmentLocal;
    SalesTable      salesTable;
    SalesTable      salesTableProj;
    boolean         standardSalesOrder = false;
    boolean         projectSalesOrder = false;
    Args            args;
    Map projSOWMSShipmentMap = new Map(typeName2Type(extendedTypeStr(RecId)), Types::Record);
    Map stdSOWMSShipmentMap = new Map(typeName2Type(extendedTypeStr(RecId)), Types::Record);

    for
    (
        wmsShipmentLocal = wmsShipment_ds.getFirst(true) ? wmsShipment_ds.getFirst(true) : wmsShipment_ds.cursor();
        wmsShipmentLocal;
        wmsShipmentLocal = wmsShipment_ds.getNext()
    )
    {
        select firstonly inventTransRefId from localWmsOrderTrans
            where localWmsOrderTrans.shipmentId == wmsShipmentLocal.shipmentId
                && localWmsOrderTrans.inventTransType == inventTransType::Sales;

        if (localWmsOrderTrans.inventTransRefId)
        {
            if (SalesTable::find(localWmsOrderTrans.inventTransRefId).ProjId)
            {
                projectSalesOrder = true;
                projSOWMSShipmentMap.insert(wmsShipmentLocal.RecId, wmsShipmentLocal);
            }
            else
            {
                standardSalesOrder = true;
                stdSOWMSShipmentMap.insert(wmsShipmentLocal.RecId, wmsShipmentLocal);
            }
        }
    }

    if (standardSalesOrder)
    {
        args = new Args();
        args.record(wmsShipment);
        args.caller(element);
        args.parmEnum(DocumentStatus::PackingSlip);
        args.parmObject(stdSOWMSShipmentMap);
        new MenuFunction(menuitemActionStr(SalesFormLetter_PackingSlip), MenuItemType::Action).run(args);
    }

    if (projectSalesOrder)
    {
        args = new Args();
        args.record(wmsShipment);
        args.caller(element);
        args.parmEnum(DocumentStatus::ProjectPackingSlip);
        args.parmObject(projSOWMSShipmentMap);
        new MenuFunction(menuitemActionStr(SalesFormLetter_PackingSlipProject), MenuItemType::Action).run(args);
    }

    element.doRefresh();
}

void  clicked()
{
    WMSShipment             wmsShipmentLocal;

    super();

    for
    (
        wmsShipmentLocal = wmsShipment_ds.getFirst(true) ? wmsShipment_ds.getFirst(true) : wmsShipment_ds.cursor();
        wmsShipmentLocal;
        wmsShipmentLocal = wmsShipment_ds.getNext()
    )
    {
        wmsShipmentLocal.sendASN();
    }
}

public void lookup()
{
    switch (wmsShipment.CarrierType_RU)
    {
        case CarrierType_W::Customer :
            ContactPerson::lookupCustContactPerson(this, wmsShipment.CarrierCode_RU);
            break;

        case CarrierType_W::Vendor :
            ContactPerson::lookupVendContactPerson(this, wmsShipment.CarrierCode_RU);
            break;

        default:
            super();
    }
}

public boolean modified()
{
    boolean ret;

    ret = super();

    if (ret)
    {
        element.setProgressSelection(this.selection());
        wmsShipment_ds.research();
    }

    return ret;
}
